  /**
   * Create and seed Ghent quarters (neighborhoods)
   * Data courtesy of Open Data Portaal Stad Gent
   * Source: Criminaliteitscijfers per wijk https://data.stad.gent/explore/dataset/criminaliteitscijfers-per-wijk-per-maand-gent-2020/table/?sort=-jaar_maand
   *
   * @private
   * @return {Promise<{ message: string; success: boolean }>}
   * @memberof SeederService
   */
  private async seedQuarters(): Promise<{ message: string; success: boolean }> {
    try {
      for (let i = 0; i < data.length; i++) {
        const q = data[i];
        const quarter = this.quartersRepository.create({
          id: q.quarterId,
          quarter: q.quarter,
          cityId: 9000,
          polygon: q.polygon,
        });
        if (quarter) {
          const savedQuarter = await this.quartersRepository.save(quarter);
          if (savedQuarter instanceof Quarter) {
            console.log(savedQuarter);
          }
        }
      }
      console.log('Got all quarters!');
      return await this.seedImages();
    } catch (err) {
      return err;
    }
  }

  /**
   * Create and seed a new report
   *
   * @param {Image} img
   * @param {CreateReportDto} rep
   * @return {Promise<Report>}
   * @memberof SeederService
   */
  async seedReport(img: Image, rep: CreateReportDto) {
    console.log('Started seeding a report');
    try {
      const report: CreateReportDto = {
        ...rep,
        imageId: img.id,
      };
      return this.reportsRepository.save(report);
    } catch (err) {
      return err;
    }
  }

